import React from "react";
import {City} from "./CityDTO";

interface iProps {
  city: City;
  key:string;
}
function CityCard(props: iProps) {
  console.log(props);
  return <div className="cityCard">
    <div>{props.city.name}</div>
    <div>{props.city.timestamp.toLocaleString()}</div>
    <img src="src/images/clock.svg"></img>
    <div>{props.city.temperature}</div>
    <div>{props.city.title}</div>
  </div>;
}
export default CityCard;
